import ReactPaginate from "react-paginate";

const Pagination = ({ totalCharacters, displayLimit }: any) => {
  return (
    <div>
      <ReactPaginate pageCount={totalCharacters / displayLimit} />
    </div>
  );
};

export default Pagination;
